// Register.js
import React, { useState } from 'react';
import { FormControl, InputLabel, Input, Button } from '@material-ui/core';
import './Register.css'

const Register = () => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [contactNumber, setContactNumber] = useState('');
    const [firstNameError, setFirstNameError] = useState('');
    const [lastNameError, setLastNameError] = useState('');
    const [emailError, setEmailError] = useState('');
    const [passwordError, setPasswordError] = useState('');
    const [contactNumberError, setContactNumberError] = useState('');
    const [registrationMessage, setRegistrationMessage] = useState('');

    const handleRegister = async() => {
        // Reset errors and messages
        setFirstNameError('');
        setLastNameError('');
        setEmailError('');
        setPasswordError('');
        setContactNumberError('');
        setRegistrationMessage('');

        // Basic validation
        if (!firstName) {
            setFirstNameError('Please fill out this field');
        }
        if (!lastName) {
            setLastNameError('Please fill out this field');
        }
        if (!email) {
            setEmailError('Please fill out this field');
        }
        if (!password) {
            setPasswordError('Please fill out this field');
        }
        if (!contactNumber) {
            setContactNumberError('Please fill out this field');
        } else if (!isValidContactNumber(contactNumber)) {
            setContactNumberError('Enter valid mobile number');
        }

        // Call your backend API endpoint '/users/register' here
        // If registration successful, you can handle it accordingly
        // For example, display a success message
        try {
            // Construct basic authentication token
            const basicAuthToken = btoa(`${email}:${password}`);

            const response = await fetch('http://localhost:8080/auth/login', {
                method: 'POST',
                headers: {
                    'Authorization': `Basic ${basicAuthToken}`,
                    'Content-Type': 'application/json',
                }
            });

            // Retrieve the access token from the response
            const data = await response.json();
            if (!response.ok) {
                setPasswordError(data.message);
                return;
            }

            const accessToken = data.accessToken;

            // Store the access token in localStorage or sessionStorage
            localStorage.setItem('accessToken', accessToken);
            localStorage.setItem('isLoggedIn', true);

            // Navigate to the home page
            // code to be implemented
        } catch (error) {
            console.error('Login failed:', error);
            setPasswordError('Failed to Login in');
        }

        setRegistrationMessage('Registration Successful');
    };

    const isValidContactNumber = (contactNumber) => {
        // Regular expression for basic mobile number validation
        // You can enhance it as per your requirements
        const contactNumberRegex = /^\d{10}$/;
        return contactNumberRegex.test(contactNumber);
    };

    return (
        <div className="register-form">
            <FormControl fullWidth margin="normal">
                <InputLabel htmlFor="firstName">First Name *</InputLabel>
                <Input
                    id="firstName"
                    type="text"
                    value={firstName}
                    onChange={(e) => setFirstName(e.target.value)}
                    error={!!firstNameError}
                />
                <span className="error">{firstNameError}</span>
            </FormControl>
            <FormControl fullWidth margin="normal">
                <InputLabel htmlFor="lastName">Last Name *</InputLabel>
                <Input
                    id="lastName"
                    type="text"
                    value={lastName}
                    onChange={(e) => setLastName(e.target.value)}
                    error={!!lastNameError}
                />
                <span className="error">{lastNameError}</span>
            </FormControl>
            <FormControl fullWidth margin="normal">
                <InputLabel htmlFor="email">Email *</InputLabel>
                <Input
                    id="email"
                    type="email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    error={!!emailError}
                />
                <span className="error">{emailError}</span>
            </FormControl>
            <FormControl fullWidth margin="normal">
                <InputLabel htmlFor="password">Password *</InputLabel>
                <Input
                    id="password"
                    type="password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    error={!!passwordError}
                />
                <span className="error">{passwordError}</span>
            </FormControl>
            <FormControl fullWidth margin="normal">
                <InputLabel htmlFor="contactNumber">Mobile No. *</InputLabel>
                <Input
                    id="contactNumber"
                    type="text"
                    value={contactNumber}
                    onChange={(e) => setContactNumber(e.target.value)}
                    error={!!contactNumberError}
                />
                <span className="error">{contactNumberError}</span>
            </FormControl>
            <Button variant="contained" className="registerButton" style={{ margin: 'auto', display: 'block' }} color="primary" onClick={handleRegister}>
                REGISTER
            </Button>
            {registrationMessage && <p>{registrationMessage}</p>}
        </div>
    );
};

export default Register;
